import React, { StrictMode } from "react";
import ReactDOM from "react-dom/client";
import Name from "./Name";
import './index.css'

function Biografi() {
  return (
    <div>
      <h1>my page</h1>
      <h2>hossein</h2>
    </div>
  )
}

ReactDOM.createRoot(document.getElementById("root")).render(
  <StrictMode>
    <>
      <Biografi />
      <Name />
    </>
  </StrictMode>
);
